import React from "react";
import Main from "./components/Main";
import { userContext } from './userContext';

import "./App.css";

class App extends React.Component {
    constructor(props) {
    super(props);
    this.state = {
      user: { isLogged: true }
    };
  }

  render() {
    return (
      <div className="App">
        <userContext.Provider value={this.state.user}>
          <Main />
        </userContext.Provider>
      </div>
    );
  }

}

export default App;
